a:260:{i:0;a:1:{s:2:"id";s:19:"2391031547979357734";}i:1;a:1:{s:10:"short_code";s:11:"CEupoZQD94m";}i:2;a:1:{s:12:"created_time";i:1599253193;}i:3;a:1:{s:7:"caption";s:2197:"What up players. 

Took my retro ass to the cats @thebrekkyclub @oldspitalfieldsmarket. Wanted to get some vintage 80's feels and no @themunchbrunchkids do it better than @thebrekkyclub.

Took my cute mum (eats like a squirrel) out on a mum and son adventures date. Put my fancy socks on. 

Rocked up. Reebok's on. Collar popped up. Quiff swirled up. Frankie says relax. 
Pics or it didn't happen. 

The kind waitress was looking after us. She was attentive....and had a pretty smile. 

Ordered:
- Reggie the veggie
- Chicken waffles
- Berries and cream pancakes with maple syrup
- Big breakfast smoothie

Waitress came over. She smiled. Mum said to her she had a nice smile. Waitress went. Told mum stop flirting. Married woman. 

Waiting for food. Playing old skool music in the background. Secretly raising the roof in my corner. Representing my corner. Disco hunger. 

Food. Reggie the veggie. Nothing overly spectacular. Standard breakfast, though potatoes nicely spiced. 

The cool chicken doing it's starfish thing on the waffles like I do when sleeping in my pink speedos, was pretty tasty. It wasn't your typical fried chicken. Chicken with personality. Really crispy and that added fried egg with a bright yellow yolk, which must've popped out from one classy chick. High maintenance. 

Waitress came back. Sweet smile again. Waitress went. Told mum to carry on flirting. Waitress came back, with food. Mum said she had a nice smile. Waitress smiled. Waitress went. Stimulated. Content. 

Up to my neck in grub but the razzle dazzle were those pancakes. Nice and fluffy like I had candy floss in my gob....never licked the lollipop mind you! 
Top notch berries n cream was a nice type of sweet. Consistent. 

Mum opened tissue out. A Leftover tomato ketchup/HP sauce sachet left. Placed in tissue. Wrapped tissue. Left. Tony Montana of condiments. 

Let's do this. 
Rated: 8.073

